,NULL),(56,'Coolio',NULL),(57,'Michael Jackson',NULL),(58,'María Natalia Lafourcade Silva','Natalia fue la primera persona educada musicalmente bajo el Método Macarsi desarrollado por su madre para ayudarla en la rehabilitación tras un accidente con un caballo que sufrió a los 6 años. Sus éxitos iniciales llegaron en la década de los 2000 con apariciones sonoras en películas como Amarte Duele y sus primeros sencillos, además de su álbum debut que llegaron a los primeros lugares de popularidad en México y son considerados como algunas de las canciones más influyentes de esa época.'),(59,'Astrid Hadad Estéfano','Es creadora del heavy nopal o neo ranchero, un estilo de performance musical de fusión que caracteriza sus presentaciones. Sus espectáculos se caracterizan por la presentación de vestuarios muy llamativos que se inspiran en la iconografía y las artes populares de México, donde todo se encuentra impregnado de una fuerte crítica política y social. Esto le valió ser vetada por Televisa, la principal televisora mexicana. Ampliamente reconocida en su país de origen y fuera de él, Hadad es también parte del grupo impulsor del Festival Internacional de Cabaret que se celebra anualmente en la Ciudad de México.'),(60,'Gustavo Adrián Cerati','Formó parte de varias agrupaciones: Savage, Vozarrón, Fricción y Soda Stereo; esta última como su banda principal, con la que logró numerosos éxitos e influencia en el género del rock en español. Tras la disolución de Soda, desarrolló una exitosa carrera como solista, que consta de cinco álbumes de estudio y diversas asociaciones con otros músicos. Durante el receso, producto de la crisis grupal, emprendió su camino en solitario a inicios de los años 1990, como proyecto paralelo a su banda oficial. En ese marco, Cerati publicó su primer álbum individual, Amor amarillo, pero al reintegrarse Soda, su aventura solista quedó en suspenso hasta la disolución absoluta de la banda.'),(61,'The XX','he XX es una banda de indie pop del suroes